import React from 'react';
import { StyledMenu } from './StyledMenu';

const Menu = ({open}) => {
  return (
    <StyledMenu open={open}>
      <a href="/story">
        <span role="img" aria-label="about us">&#x1f481;&#x1f3fb;&#x200d;&#x2642;&#xfe0f;</span>
        Our Story 
      </a>
      <a href="#plants">
        <span role="img" aria-label="price">&#x1f4b8;</span>
        Plants
        </a>
    </StyledMenu>
  )
}
export default Menu;
